import logo from '../assets/logo.svg';
import {HiShoppingCart} from 'react-icons/hi'
const Navbar = () => {
  return (
    <div className='flex jus'>
      <div>
        <img src={logo} alt="logo" className='w-[7rem]'/>
      </div>
      <div>
        <p>Home</p>
        <HiShoppingCart/>
      </div>
    </div>
  );
};

export default Navbar;
